function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Fournisseur />}></Route>
          <Route path='/create' element={<CreateFournisseur />}></Route>

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
